(1811, '_transient_catchresponsive_featured_content', '\n				<section id=\"featured-content\" class=\"layout-three demo-featured-content\">\n					<div class=\"wrapper\"><div class=\"featured-heading-wrap\"><h2 id=\"featured-heading\" class=\"entry-title\">Featured Content</h2><p>Here you can showcase the x number of Featured Content. You can edit this Headline, Subheadline and Feaured Content from \"Appearance -&gt; Customize -&gt; Featured Content Options\".</p></div><!-- .featured-heading-wrap -->\n						<div class=\"featured-content-wrap\">\n		<article id=\"featured-post-1\" class=\"post hentry post-demo\">\n			<figure class=\"featured-content-image\">\n				<img alt=\"Central Park\" class=\"wp-post-image\" src=\"http://www.pcrworks.we2host.lt/wp-content/themes/catch-responsive/images/gallery/featured1-350x197.jpg\" />\n			</figure>\n			<div class=\"entry-container\">\n				<header class=\"entry-header\">\n					<h2 class=\"entry-title\">\n						Central Park\n					</h2>\n				</header>\n				<div class=\"entry-content\">\n					Central Park is is the most visited urban park in the United States as well as one of the most filmed locations in the world. It was opened in 1857 and is expanded in 843 acres of city-owned land.\n				</div>\n			</div><!-- .entry-container -->\n		</article>\n\n		<article id=\"featured-post-2\" class=\"post hentry post-demo\">\n			<figure class=\"featured-content-image\">\n				<img alt=\"Home Office\" class=\"wp-post-image\" src=\"http://www.pcrworks.we2host.lt/wp-content/themes/catch-responsive/images/gallery/featured2-350x197.jpg\" />\n			</figure>\n			<div class=\"entry-container\">\n				<header class=\"entry-header\">\n					<h2 class=\"entry-title\">\n						Home Office\n					</h2>\n				</header>\n				<div class=\"entry-content\">\n					It might be work, but it doesn\'t have to feel like it. All you need is a comfortable desk, nice laptop, home office furniture that keeps things organized, and the right lighting for the job.\n				</div>\n			</div><!-- .entry-container -->\n		</article>\n\n		<article id=\"featured-post-3\" class=\"post hentry post-demo\">\n			<figure class=\"featured-content-image\">\n				<img alt=\"Vespa Scooter\" class=\"wp-post-image\" src=\"http://www.pcrworks.we2host.lt/wp-content/themes/catch-responsive/images/gallery/featured3-350x197.jpg\" />\n			</figure>\n			<div class=\"entry-container\">\n				<header class=\"entry-header\">\n					<h2 class=\"entry-title\">\n						Vespa Scooter\n					</h2>\n				</header>\n				<div class=\"entry-content\">\n					The Vespa Scooter has evolved from a single model motor scooter manufactured in the year 1946 by Piaggio & Co. S.p.A. of Pontedera, Italy-to a full line of scooters, today owned by Piaggio.\n				</div>\n			</div><!-- .entry-container -->\n		</article>\n						</div><!-- .featured-content-wrap -->\n					</div><!-- .wrapper -->\n				</section><!-- #featured-content -->', 'no'),
