INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(1, 1, '2018-11-25 12:23:40', '2018-11-25 14:23:40', '<span style=\"font-size: 8pt;\">Sveikiname pasirinkus WordPress. Tai pirmasis jūsų tinklalapio įrašas, galite jį redaguoti arba ištrinti.</span>', 'Pirmasis tinklalapio įrašas!', '', 'publish', 'open', 'open', '', 'pirmasis-tinklarascio-irasas', '', '', '2018-12-01 17:50:22', '2018-12-01 19:50:22', '', 0, 'http://www.pcrworks.we2host.lt/?p=1', 0, 'post', '', 0),
(2, 1, '2018-11-25 12:23:40', '2018-11-25 14:23:40', 'Tai yra puslapio pavyzdys. Puslapis šiek tiek skiriasi nuo įrašo, nes išlieka vienoje vietoje ir daugelyje temų rodomas meniu juostoje. Dažniausiai pirmasis puslapis yra „Apie“, kuriame tinklaraščio autoriai gali prisistatyti savo skaitytojams. Šis puslapis gali atrodyti taip:\n\n<blockquote>Sveiki! Aš dirbu kurjeriu, o laisvu laiku bandau tapti aktoriumi, ir rašau šį tinklaraštį. Gyvenu Vilniuje, turiu šunį, vardu Reksas, ir mėgstu gerti sultis.</blockquote>\n\n…arba štai taip:\n\n<blockquote>UAB „Pavyzdinė įmonė“ buvo įkurta 1971-iais metais ir nuo to laiko gamina įvairaus tipo lazerius. „Pavyzdinė įmonė“ įsikūrusi Kaune, joje dirba apie 200 fizikos specialistų.</blockquote>\n\nKadangi esate naujas(-a) WordPress vartotojas(-a), apsilankykite savo <a href=\"http://www.pcrworks.we2host.lt/wp-admin/\">administravimo sąsajoje</a>, ištrinkite šį puslapį ir susikurkite naujų su savo turiniu. Mėgaukitės!', 'Puslapio pavyzdys', '', 'publish', 'closed', 'open', '', 'puslapio-pavyzdys', '', '', '2018-11-25 12:23:40', '2018-11-25 14:23:40', '', 0, 'http://www.pcrworks.we2host.lt/?page_id=2', 0, 'page', '', 0),
(3, 1, '2018-11-25 12:23:40', '2018-11-25 14:23:40', '<h2>Kas mes esame</h2><p>Mūsų tinklalapio adresas yra: http://www.pcrworks.we2host.lt</p><h2>Kokius asmeninius duomenis mes renkame ir kodėl tai darome</h2><h3>Komentarai</h3><p>Kai lankytojai rašo komentarus tinklalapyje, mes renkame duomenis, matomus komentaro paskelbimo formoje, o taip pat lankytojo IP adresą bei naršyklės vartotojo įrašą, kad apsisaugotume nuo brukalų.</p><p>Iš Jūsų el.pašto adreso gali būti sugeneruotas anonimizuotas duomenų įrašas (angl. hash)  ir pateiktas Gravatar paslaugos teikėjui, norint patikrinti, ar Jūs naudojatės šia paslauga. Gravatar privatumo politika pateikiama čia: https://automattic.com/privacy/. Patvirtinus Jūsų komentarą, Jūsų profilio nuotrauka yra matoma viešai šalia Jūsų komentaro.</p><h3>Failai</h3><p>Jei įkeliate nuotraukas į tinklalapį, turėtumėte vengti įkelti jas su išsaugotais vietovės duomenimis (EXIF GPS). Tinklalapio lankytojai gali parsisiųsti nuotraukas iš tinklalapio ir iš jų išgauti vietovės duomenis.</p><h3>Kontaktų formos</h3><h3>Slapukai (cookies)</h3><p>Kai Jūs rašote komentarą šiame tinklalapyje, Jūs galite pasirinkti, ar norite, kad Jūsų vardas, el.paštas ir tinklalapis būtų išsaugotas slapukuose. Taip daroma Jūsų patogumui, kad Jums nereikėtų šių duomenų suvedinėti iš naujo, kiekvieną kartą kai komentuojate. Šie slapukai saugomi vienerius metus.</p><p>Jei Jūs turite paskyrą ir prisijungiate mūsų tinklalapyje, mes sukuriame laikiną slapuką, kuriame įrašoma, ar Jūsų naršyklė priima slapukus. Šis slapukas nesaugo jokios asmeninės informacijos ir yra ištrinamas kai uždarote savo naršyklę.</p><p>Kai Jūs prisijungiate, mes taip pat sukuriame kelis slapukus, kuriuose saugoma Jūsų prisijungimo informacija ir Jūsų ekrano rodymo pasirinkimai. Prisijungimo slapukai galioja 2 dienas, o ekrano nustatymų - vienerius metus. Jei Jūs pažymite pasirinkimą &quot;Prisiminti mane&quot;, Jūsų prisijungimo slapukas galios 2 savaites. Kai atsijungiate iš savo paskyros, prisijungimo slapukai ištrinami.</p><p>Jei redaguojate ar paskelbiate įrašą, Jūsų naršyklėje išsaugomas papildomas slapukas. Šis slapukas nesaugo asmeninių duomenų, tačiau išsaugo įrašo, kurį ką tik redagavote ar paskelbėti, ID. Šis slapukas baigia galioti po 1 dienos.</p><h3>Iš kitų tinklalapių įkeltas turinys</h3><p>Šiame tinklalapyje gali būti iš kitų tinklalapio įkelto turinio (pavyzdžiui, video, paveikslėliai, tekstas ir pan.). Tokio įkelto turinio peržiūra ir veiksmai su juo šiame tinklalapyje prilygsta apsilankymui tuose tinklalapiuose, iš kurių turinys yra įkeltas.</p><p>Šie tinklalapiai gali rinkti duomenis apie Jus, naudoti slapukus (cookies), trečiųjų šalių sekimo paslaugas ir stebėti Jūsų veiksmus su įkeltu turiniu, įskaitant ir tuos atvejus, kai turite paskyrą ir esate prisijungęs prie minėtų tinklalapių.</p><h3>Statistika</h3><h2>Su kuo mes dalinamės Jūsų duomenimis</h2><h2>Kaip ilgai mes saugome Jūsų duomenis</h2><p>Jei parašote komentarą, jo tekstas ir metaduomenys yra saugomi neribotą laiką. Taip daroma todėl, kad galėtume atpažinti ir patvirtinti ateities komentarus automatiškai, vietoje administratoriaus patvirtinimo.</p><p>Kai užsiregistruojate mūsų tinklalapyje ir tampate vartotoju, mes saugome visus Jūsų asmeninius duomenis, kuriuos Jūs pateikiate savo paskyroje. Kiekvienas vartotojas gali matyti, redaguoti ir ištrinti savo asmeninius duomenis bet kuriuo metu (išskyrus vartotojo vardą). Tinklalapio administratoriai tai pat gali matyti ir redaguoti šiuos duomenis.</p><h2>Jūsų teisės</h2><p>Jei Jūs turite paskyrą šiame tinklalapyje, arba kada nors rašėte čia komentarą, galite reikalauti gauti duomenų eksporto failą su visais asmeniniais duomenimis, kuriuos mes turime apie Jus, įskaitant ir tuos, kuriuos pats mums pateikėte. Jūs taip pat galite reikalauti, kad mes ištrintume visus mūsų turimus Jūsų asmeninius duomenis. Šie abu reikalavimai negalioja duomenims, kuriuos mes privalome išsaugoti pagal įstatymą administraciniams, teisiniams ar saugumo tikslams.</p><h2>Kur mes siunčiame Jūsų duomenis</h2><p>Lankytojų komentarai gali būti tikrinami naudojant automatinę brukalų paieškos paslaugą.</p><h2>Kontaktinė informacija</h2><h2>Papildoma informacija</h2><h3>Kaip mes saugome Jūsų duomenis</h3><h3>Kokias duomenų apsaugos procedūras mes naudojame</h3><h3>Iš kokių trečiųjų šalių mes gauname duomenis</h3><h3>Kokius automatinius sprendimus ir/ar profiliavimą mes atliekame naudodami Jūsų duomenis</h3><h3>Reguliuojamų veiklos sričių informacija</h3>', 'Privatumo politika', '', 'draft', 'closed', 'open', '', 'privatumo-politika', '', '', '2018-11-25 12:23:40', '2018-11-25 14:23:40', '', 0, 'http://www.pcrworks.we2host.lt/?page_id=3', 0, 'page', '', 0),
