(23, 1, '2018-11-25 12:27:59', '2018-11-25 14:27:59', 'Tai Jūsų naujasis tinklalapis! Dabar matote pradinį puslapį, kurį dažniausiai matys lankytojai, užsukę į Jūsų tinklalapį pirmą kartą.', 'Pradinis', '', 'inherit', 'closed', 'closed', '', '17-revision-v1', '', '', '2018-11-25 12:27:59', '2018-11-25 14:27:59', '', 17, 'http://www.pcrworks.we2host.lt/2018/11/25/17-revision-v1/', 0, 'revision', '', 0),
(24, 1, '2018-11-25 12:27:59', '2018-11-25 14:27:59', 'Galbūt Jūs esate menininkas - tuomet čia pristatykite save ir savo darbus. Arba - jei tai verslo tinklalapis - įrašykite čia savo verslo misiją.', 'Apie', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2018-11-25 12:27:59', '2018-11-25 14:27:59', '', 18, 'http://www.pcrworks.we2host.lt/2018/11/25/18-revision-v1/', 0, 'revision', '', 0),
(25, 1, '2018-11-25 12:27:59', '2018-11-25 14:27:59', 'Tai yra puslapis su pagrindine kontaktine informacija, tokia kaip adresas ir telefonas. Taip pat panaudojus įskiepį, šiame puslapyje galite įdėti kontaktų formą.', 'Susisiekite', '', 'inherit', 'closed', 'closed', '', '19-revision-v1', '', '', '2018-11-25 12:27:59', '2018-11-25 14:27:59', '', 19, 'http://www.pcrworks.we2host.lt/2018/11/25/19-revision-v1/', 0, 'revision', '', 0),
